import React from 'react'


import Footer from '../Footer/Footer';
import Header from '../Header/Header';
import jwtInterceptor from '../../helpers/jwtInterceptor';
import { useEffect } from 'react';
import { useState } from 'react';
import axios from 'axios';

function OrdersDetail() {

    const [orders, setOrders] = useState()
    useEffect(() => {
        const getordersbyid = async () => {
            try {
                const userid = JSON.parse(localStorage.getItem('user')).data._id;
                const resp = await jwtInterceptor.get("http://localhost:8000/api/order/getordersbyid/" + userid, { withCredentials: true });
                return resp.data.data;
            } catch (err) {
            }
        }

        const fetchOrders = async () => {
            const ordersData = await getordersbyid();
            setOrders(ordersData);
        }

        fetchOrders();
    }, []);

    const getproductprice = async (productId) => {
        try {
            const resp = await axios.get("http://localhost:8000/api/product/getproductbyid/" + productId)
            console.log(resp.data.data.price);
            return resp.data.data.price
        } catch (err) {
        }
    }
    const getorderprice = async (order) => {
        let sum = 0
        for (let i = 0; i < order.products; i++) {
            const productprice = await getproductprice(order.products[i].product)
            console.log(productprice);
            sum = sum + (productprice * order.products[i].quantity)
        }
        console.log(sum);
        return sum
    }
    const o = {
        "_id": "652e421ef458f61a44093f36",
        "products": [
            {
                "product": "6515b7d34e0ea1c902e8564a",
                "quantity": 1,
                "_id": "652e421ef458f61a44093f37"
            }
        ],
        "user": "652e3e79df24796e08dc3acd",
        "date": "17/10/2023 10:13:18"
    }
    const calculateOrderPrice = async () => {
        const result = await getorderprice(o);
        console.log(result);
    }

    calculateOrderPrice()

    return (
        orders && (
            <div>
                <Header />
                <div className="container mb-4 main-container">
                    <div className="row">
                        {/* Orders Table */}
                        <div className="col-lg-12 pb-4">
                            <div className="d-flex justify-content-end pb-3">
                                <div className="form-inline">
                                    <label className="text-muted mr-3" htmlFor="order-sort">Sort Orders</label>
                                    <select className="form-control" id="order-sort">
                                        <option>All</option>
                                        <option>Delivered</option>
                                        <option>In Progress</option>
                                        <option>Delayed</option>
                                        <option>Canceled</option>
                                    </select>
                                </div>
                            </div>
                            <div className="table-responsive">
                                <table className="table table-hover mb-0">
                                    <thead>
                                        <tr>
                                            <th>Order #</th>
                                            <th>Date Purchased</th>
                                            <th>Status</th>
                                            <th>Total</th>
                                        </tr>
                                    </thead>
                                    <tbody>
                                        {
                                            (new Array(orders.length).fill(0)).map((val, index) => (
                                                <tr>
                                                    <td><a className="navi-link" data-toggle="modal">{orders[index]._id}</a></td>
                                                    <td>{orders[index].date}</td>
                                                    <td><span className="badge bg-success">Success</span></td>
                                                    <td><span >{async () => await getorderprice(orders[index])}</span></td>
                                                </tr>
                                            ))
                                        }
                                    </tbody>
                                </table>
                            </div>
                        </div>
                    </div>
                </div>
                <br />
                <br />
                <br />
                <br />
                <br />
                <br />
                <br />
                <br />
                <br />
                <br />
                <br />
                <br />

                <Footer />
            </div>)

    )
}

export default OrdersDetail
